import React from 'react';

class Pokemon extends React.Component {

  render() {

    const pokeData = this.propos;

    return (

      pokeData.map((element) => (
        `Nome: ${element.name}`
        `Tipo: ${element.type}`
        `Peso médio: ${element.averageWeight}`
        `Foto: ${element.image}`
      ))

    )
  }
}

export default Pokemon;
